(function() {
    var def_img = 'data:image/gif;base64,';

    // If injecting into an app that was already running at the time
    // the app was enabled, simply initialize it.
    if (document.documentElement) {
        initialize();
    }

    // Otherwise, we need to wait for the DOM to be ready before
    // starting initialization since add-ons are usually (always?)
    // injected *before* `document.documentElement` is defined.
    else {
        window.addEventListener('DOMContentLoaded', initialize);
    }

    function initialize() {

        var observer = new MutationObserver(function(mutations) {
            mutations.forEach(function(mutation) {

                if (mutation.attributeName === 'class' && mutation.target.classList.contains('current')) {
                    var addonDetailsHeader = mutation.target.querySelector('.addon-details-header');
                    var customSettings = mutation.target.querySelector('.status-bar-gif');

                    if (customSettings) {
                        customSettings.parentElement.removeChild(customSettings);
                        customSettings = null;
                    }

                    if (addonDetailsHeader.textContent === 'Wax Apple') {

                        var settings = window.navigator.mozSettings;

                        customSettings = document.createElement('div');
                        customSettings.classList.add('status-bar-gif');

                        var addonDetailsBody = mutation.target.querySelector('.addon-details-body');
                        var filterHeader = addonDetailsBody.querySelector('header');
                        addonDetailsBody.insertBefore(customSettings, filterHeader);

                        var header = document.createElement('header');
                        header.classList.add('status-bar-gif');

                        var h2 = document.createElement('h2');
                        h2.textContent = 'Settings';

                        header.appendChild(h2);
                        customSettings.appendChild(header);

                        var ul = document.createElement('ul');
                        //<input type="file" onchange="previewFile()"><br>
                        //<img src="" height="200" alt="Image preview...">
                        var liURL = document.createElement('li');
                        var input = document.createElement('input');
                        input.type= "file"
                        liURL.appendChild(input)
                        ul.appendChild(liURL);

                        customSettings.appendChild(ul);

                        var liPreview = document.createElement('li');
                        var preview = document.createElement('img')
                        liPreview.appendChild(preview)
                        ul.appendChild(liURL);

                
                        input.addEventListener('change', function() {
                            var files = evt.target.files;
                            var file = files && files[0];

                            if (file) {
                              var reader = new FileReader();
                              reader.onload = function(readerEvt) {
                                var binaryString = readerEvt.target.result;
                                settings.createLock().set({
                                  'statusbar-gif.url': evt.target.value,
                                  'statusbar-gif.data': readerEvt.target.result
                                });
                                // update the actual gif.
                              };
                              reader.readAsBinaryString(file);
                            }

                            
                        });

                        // Get current gif
                        var reqImageData = settings.createLock().get('statusbar-gif.data');

                        reqImageData.onsuccess = function() {
                            var data = reqImageData.result['statusbar-gif.data'];
                            preview.src = data;
                        };

                        reqImageData.onerror = function() {
                            // Can not get gif from settings
                            settings.createLock().set({
                                'statusbar-gif.data': def_img
                            });
                            preview.src = def_img;
                        };

                    }
                }
            });
        });

        var waitForAddonDetails = setInterval(function() {
            // Get the addon details page
            var detailsEl = document.getElementById('addon-details');

            if (!detailsEl) {
                return;
            }

            clearInterval(waitForAddonDetails);

            observer.observe(detailsEl, {
                attributes: true
            });

        }, 500);

    }

}());
